import { assets } from "../Assets/assets";
function Footer() {
    return (
        <>
        <div id = "footer-div">
            <img src= {assets.logo_light} height ={40} width={120}/>
            <p id = "footer-p">All right reserved. Copyright @blogger</p>
            <div id = "sm-div"></div>
        </div>
        </>
    )
}

export default Footer;
